import React from "react"
import Button from "@material-ui/core/Button"
import { Link } from "react-router-dom";

export default function HomeIcon() {
    return (
        <Link 
        to={"/"}
        style={{
            fontFamily: "sans serif, verdana",
            fontSize: 30
        }}
        >
                NANOVERT
        </Link>
    )
}
